import styled from "styled-components";
import "@fontsource/roboto";
import "@fontsource/arimo";

export const EditUserContainer = styled.div`

    width: 100%;
    height: 108px;
    border-bottom: solid 1px #FF000050;

    padding: 0px 10px;
    display: flex;
    justify-content: space-between;

    form{
        width: 100%;
        display: flex;
        justify-content: space-between;
        align-items: center;

        input{
            height: 50px;
            width: 150px;
            border-radius: 10px;

            padding: 10px 10px;
            font-size: 16px;


            &::placeholder{
                font-family: "Arimo", sans-serif;
            }
        }

        button{
            margin-left: auto;
        }
    }

`
